import styled from 'styled-components'
import {Baidu} from '../../../styles/Icons'
export const Container = styled.div`
    display: flex;
    justify-content: center;
    width: 100%;
    padding: 6px 3%;

`
export const LogoBread = styled(Baidu)`
    color: #f0f8ff;
    width: 43px;
    height: 43px;
`
